import React, { useEffect, useState } from 'react';
import Button from './buttonLogin';
import Option from './option';
import { NavBarDropdown } from './navBarDropdown';
import { Cards } from './cards';


export default function StudentNotifications() {
    return (
        <>
            <h1>Notifications</h1>
            <ul className="list-group p-2">
                <li className="list-group-item bg-success-subtle position-relative">
                    <span class="position-absolute top-0 start-0 translate-middle p-2 bg-danger border border-light rounded-circle">
                        <span class="visually-hidden">New alerts</span>
                    </span>
                    <span className="bg-success-subtle">Someone has accepted your tuition request for subject <b>Java</b></span>
                </li>

                <li className="list-group-item .text-danger-emphasis">Someone has rejected your tuition request for subject <b>C++</b></li>
                <li className="list-group-item .text-warning-emphasis">Your request is pending with this teacher for subject <b>Python</b></li>
                <li className="list-group-item">A fourth item</li>
                <li className="list-group-item">And a fifth one</li>
            </ul>
        </>
    )
}
